import React from "react";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";

const AppNavbar = ({ newColor }) => {
  return (
    <Navbar expand="lg" style={{ background: newColor }}>
      <Navbar.Brand href="#home">React Color Change Project</Navbar.Brand>
    </Navbar>
  );
};

export default AppNavbar;
